// SPDX-License-Identifier: MIT
pragma solidity ^0.8.12;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract WTIAAuction {
  using SafeMath for uint256;

  struct Auction {
    // block.timestamp returns uint hence dates are in uint
    uint256 startDate;
    uint256 endDate;
    uint256 startPrice;
    address creator;
  }

  mapping(uint256 => Auction) public Auctions;

  /* ID would be passed through the UI or could be kept track adding a sperate variable
  _endDate would be passed through UI as the time in seconds to be directly added to
  current time an example of this would be 3600 for 1 Hour */
  constructor(uint256 id, uint256 _endDate, uint256 _startPrice) {
    Auctions[id] = Auction(block.timestamp, (block.timestamp.add(_endDate)), _startPrice, msg.sender);
  }

  function getPrice(uint256 _id) public view returns (uint256) {
    uint256 timeDifference = uint256(Auctions[_id].endDate).sub(Auctions[_id].startDate); // Total time difference
    uint256 slope = uint256(Auctions[_id].startPrice).div(timeDifference); // Cost to decrease per second
    uint256 currentTime = block.timestamp; // Current Time
    uint256 price = uint256(Auctions[_id].startPrice).sub(slope.mul(Auctions[_id].startDate).sub(currentTime));
    return uint256(price);
  }
}
